public class OneSevenFiveCompetition {

    @Test
    public void test01(){
        Assert.assertTrue(checkIfExist(new int[]{10,2,5,3}));
        Assert.assertTrue(checkIfExist(new int[]{3,1,7,11})==false);
    }
    public boolean checkIfExist(int[] arr) {
        for (int i=0; i < arr.length; i++){
            int number = arr[i] * 2;
            for (int j=0; j < arr.length; j++){
                if (j != i && arr[j] == number){
                    return true;
                }
            }
        }
        return false;
    }

    @Test
    public void test02(){
        Assert.assertTrue(minSteps("",
                "")==290);
        Assert.assertTrue(minSteps("leetcode","practice")==5);
    }
    public int minSteps(String s, String t) {
        int sum = s.length();
        Map<Character,Integer> sMap = new TreeMap<>();
        Map<Character,Integer> tMap = new TreeMap<>();
        for (Character character : s.toCharArray()){
            sMap.put(character,sMap.getOrDefault(character,0)+1);
        }
        for (Character character : t.toCharArray()){
            tMap.put(character,tMap.getOrDefault(character,0)+1);
        }
        for (Map.Entry<Character,Integer> sEntry : sMap.entrySet()){
            if (tMap.containsKey(sEntry.getKey())){
                int min = Integer.min(sEntry.getValue(),tMap.get(sEntry.getKey()));
                sum -= min;
            }
        }
        return sum;
    }

    @Test
    public void test03(){
        Assert.assertTrue(true);
    }

    private Map<String,List<Integer>> record;
    private Map<String,Integer> initData;
    public void  TweetCounts() {
        record = new HashMap<>();
        initData = new HashMap<>();
        initData.put("minute",60);
        initData.put("hour",3600);
        initData.put("day",24*3600);
    }
    public void recordTweet(String tweetName, int time) {
        if (record.containsKey(tweetName)) record.get(tweetName).add(time);
        else {
            List<Integer> init = new ArrayList<>();
            init.add(time);
            record.put(tweetName,init);
        }
    }
    public List<Integer> getTweetCountsPerFrequency(String freq, String tweetName, int startTime, int endTime) {
        if (!record.containsKey(tweetName)) return new ArrayList<>();
        List<Integer> timeList = record.get(tweetName);
        Integer delta = initData.get(freq);
        int time = startTime;
        int i = 1;
        List<Integer> result = new ArrayList<>();
        while (time <= endTime){
            int finalStart = time;
            int finalEnd = startTime + delta * i;
            if (finalEnd <= endTime){
                long count = timeList.stream()
                        .filter(tmp -> tmp.intValue()>= finalStart &&tmp.intValue()<finalEnd)
                        .count();
                result.add((int) count);
            }else{
                long count = timeList.stream()
                        .filter(tmp -> tmp.intValue()>= finalStart &&tmp.intValue()<=endTime)
                        .count();
                result.add((int) count);
            }
            time = finalEnd;
            i++;
        }
        return result;
    }

    @Test
    public void test04(){
        Assert.assertTrue(true);
    }
}
